public class Solution {

    private int[] dp;

    // Time: O(m), m is the length of the string
    // Space: O(m)
    public int minRemove(String A, String B) {
        assert A.length() >= B.length();
        if (A.length() < B.length()) return -1;
        int a = A.length(), b = B.length();

        dp = new int[b];
        for (int i = 0; i < b; i++)
            dp[i] = i > 0? b - i : -1;

        for (int shift = 1; shift <= a; shift++) {
            dfs(A, B, shift);
        }
        return dp[b - 1];
    }

    private void dfs(String A, String K, int shift) {
        if(shift == 0) {
            return;
        }
        int min = A.length() - K.length() + 1;
        int max = A.length() + shift - 1;
        for (int b = min; b <= max; b++) {
            dp[b-1] = Math.min(dp[b-1], minRemove(A.substring(A.length()-shift, A.length()-shift+b) + '*', K));
        }
    }
}
